import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';


export default function ByColorResults(props) {

  const [data, setData] = React.useState([])
  React.useEffect(() => {
    fetch(`/api/v1/${props.colorProp}`)
      .then((res) => res.json())
      .then((res) => { console.log(res, "here"); setData(res.groups) });
  }, [props.colorProp]);

  return (
    <TableContainer component={Paper} sx={{ width: "75%" }}>
      <Table aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Group Name</TableCell>
            <TableCell align="right">User Name</TableCell>

          </TableRow>
        </TableHead>
        <TableBody>


          {Object.keys(data).map(group => <TableRow
            key={group}
            sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
          ><TableCell component="th" scope="row">
              {group}
            </TableCell>
            <TableCell align="right">
            <Table sx={{ minWidth: 500 }} aria-label="simple table">
              {data[group].map (person=>{return <TableRow > <TableCell align="right"  sx={{ padding: "2px 10px" , borderBottom: "none"}}>{person}</TableCell></TableRow>})}
              </Table>
            </TableCell>
          </TableRow>)}




        </TableBody>
      </Table>
    </TableContainer>
  );
}
